import React from 'react'
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Banner from '../components/Banner';
import CarKey from '../components/imgs/car_key.png'
import CountUp from 'react-countup';

const About = () => {
    return (
        <div>
            <Navbar />
            <div className="empty_space"></div>
            <Banner title="Rólunk" />
            <div className="about_banner_container">
            <img src={CarKey} alt="" className="about_banner" />
            <h1 className="banner_title">Nálunk tényleg ilyen egyszerű a kölcsönzés.</h1>
            </div>
            <div className="counter_container">
                <CountUp delay={2} start={0} end={7654} duration={1} />


            </div>

            
            <Footer />
        </div>
    )
}

export default About
